const DreamPage = (obj) => {
    const dreamName = obj.dreamName;
    const dreamDate = obj.date;
    const dreamContent = obj.dreamContent;
    const dreamPersonalScore = obj.personalScore;
    const dreamPositivityScore = obj.positivityScore;
    const dreamPrideScore = obj.prideScore;
    const dreamUnique = obj.isUnique;
    const dreamSeriesName = obj.seriesName;
    const emotionTags = obj.emotionTags;
    const peopleTags = obj.peopleTags;
    const placesTags = obj.placesTags;
    const generalTags = obj.GeneralTags;
    const dreamIsLucid = obj.isLucid;
    const dreamLucidControl = obj.lucidControl;
    const dreamLucidClarity = obj.lucidClarity;
    const dreamLucidCohesion = obj.lucidCohesion;
    const dreamIsNightmare = obj.isNightmare;
    const dreamNightmareIntensity = obj.nightmareIntensity;
    const dreamNightmareReactionRun = obj.nightmareReaction.run.checked;
    const dreamNightmareReactionFightBack = obj.nightmareReaction.fightBack.checked;
    const dreamNightmareReactionHide = obj.nightmareReaction.hide.checked;
    const dreamNightmareReactionFreeze = obj.nightmareReaction.freeze.checked;
    const dreamNightmareReactionGoWithIt = obj.nightmareReaction.goWithIt.checked;
    const wouldDoIRL = obj.situationIRL;
    const dreamPersonalInterpretation = obj.personalInterpretation;

    cpnsole.log(obj.nightmareReaction.fightBack.checked);
    const tagsToP = (arr) => arr.map((tag)=><p>{tag}</p>);
    const isUnique = (bool) => bool ? "A Unique Dream" : "Part of Series: " + dreamSeriesName;
    const scoreParams = (textParam ,lucidParam) => {
        return(
            <span>
                <h4>{textParam}: </h4>
                <p>{lucidParam}</p>
            </span>
        )
    }

    return(
        <div style={{
            display: "felx",
            justifyContent: "center",
            padding: "10px 20px 20px 10px",
            gap: "15px"
        }}>
            <h1 style={{display: dreamName === "" ? "none" : "auto"}}>{dreamName}</h1>
            <h4>{dreamDate}</h4>
            <h2>{dreamContent}</h2>
            <h4>{isUnique(dreamUnique)}</h4>
            <section>
                <h2>Tags</h2>
                <h3 style={{display: emotionTags.length > 0 ? "auto" : "none"}}>Emotions Tags: {tagsToP(emotionTags)}</h3>
                <h3 style={{display: peopleTags.length > 0 ? "auto" : "none"}}>People Tags: {tagsToP(peopleTags)}</h3>
                <h3 style={{display: placesTags.length > 0 ? "auto" : "none"}}>Places Tags: {tagsToP(placesTags)}</h3>
                <h3 style={{display: generalTags.length > 0 ? "auto" : "none"}}>General Tags: {tagsToP(generalTags)}</h3>
            </section>
            <section style={{display: dreamIsLucid ? "auto" : "none"}}>
                <h2>Lucid</h2>
                {scoreParams("Control: ", {dreamLucidControl})}
                {scoreParams("Clarity: ", {dreamLucidClarity})}
                {scoreParams("Cohesino: ", {dreamLucidCohesion})}
            </section>
            <section  style={{display: dreamIsNightmare ? "auto" : "none"}} >
                <h2>Nightmare</h2>
                {scoreParams("Intensity: ", {dreamNightmareIntensity})}
                <h3>Reaction</h3>
                <p style={{display: dreamNightmareReactionRun ? "auto" : "none"}}>Run</p>
                <p style={{display: dreamNightmareReactionFightBack ? "auto" : "none"}}>Fight Back</p>
                <p style={{display: dreamNightmareReactionHide ? "auto" : "none"}}>Hide</p>
                <p style={{display: dreamNightmareReactionFreeze ? "auto" : "none"}}>Freeze</p>
                <p style={{display: dreamNightmareReactionGoWithIt ? "auto" : "none"}}>Just Go With It</p>
            </section>
            <section>
                {scoreParams("Dream Personal Score: ", {dreamPersonalScore})}
                {scoreParams("Dream Positivity Score: ", {dreamPositivityScore})}
                {scoreParams("Dream Pride Score: ", {dreamPrideScore})}
            </section>
            <section>
                <p>What would you do in real life?</p>
                <p>{wouldDoIRL}</p>
                <p>Insights and personal interpretation</p>
                <p>{dreamPersonalInterpretation}</p>
            </section>
        </div>
    )
}

export default DreamPage;
